-- Procedure structure for publish_procedure
-- ----------------------------
DROP PROCEDURE IF EXISTS `publish_procedure`;
DELIMITER ;;
CREATE DEFINER=`root`@`localhost` PROCEDURE `publish_procedure`(gid bigint(8),period int,pubHisTable varchar(225),rctPubTable varchar(225),goodsTable varchar(225),buyHisTable_g varchar(225),baseCode int)
BEGIN SET @sqlpubhis = CONCAT('UPDATE ',pubHisTable,' pt ,goods.',goodsTable,' gt SET pt.lucky_code = ',baseCode,' +FLOOR(RAND()*gt.totalCount+1),pub_status = 1 WHERE pt.gid=gt.gid AND pub_status = 0 AND pt.gid=',gid,' AND pt.period = ',period); SET @sqlgetpid = CONCAT('UPDATE ',pubHisTable,' pt ,',buyHisTable_g, ' bt SET pt.pid = bt.pid,pt.nickname=bt.nickname WHERE pt.gid = bt.gid AND pt.period = bt.period AND pt.lucky_code = bt.code AND pt.gid = ',gid,' AND pt.period = ',period); SET @sqlbuyhisg = CONCAT('UPDATE ',buyHisTable_g,' SET pub_status = 1 where gid = ',gid, ' AND period = ',period); SET @sqlbuycount = CONCAT('UPDATE ',pubHisTable,' SET buyCount = (SELECT a.buyCount FROM(SELECT COUNT(*) buyCount FROM  ',buyHisTable_g,' bt, ',pubHisTable,' pt WHERE bt.gid=pt.gid AND bt.period=pt.period AND bt.gid= ',gid,' AND bt.pid=pt.pid and bt.period= ',period,' )a) WHERE gid=',gid,' AND period=',period); SET @sqlrecpub = CONCAT('UPDATE ',rctPubTable,' rt ,',pubHisTable,' pt SET rt.lucky_code = pt.lucky_code,rt.pub_status = 1,rt.pid = pt.pid,rt.nickname=pt.nickname,rt.buyCount=pt.buyCount WHERE rt.gid=pt.gid AND rt.pub_status = 0 AND rt.period = pt.period'); PREPARE stmtpubhis FROM @sqlpubhis; PREPARE stmtgetpid FROM @sqlgetpid; PREPARE stmtbuyhisg FROM @sqlbuyhisg; PREPARE stmtbuycount FROM @sqlbuycount; PREPARE stmtrecpub FROM @sqlrecpub; EXECUTE stmtpubhis; EXECUTE stmtgetpid; EXECUTE stmtbuyhisg; EXECUTE stmtbuycount; EXECUTE stmtrecpub; DEALLOCATE PREPARE stmtpubhis; DEALLOCATE PREPARE stmtgetpid; DEALLOCATE PREPARE stmtbuyhisg; DEALLOCATE PREPARE stmtbuycount; DEALLOCATE PREPARE stmtrecpub; END
;;
DELIMITER ;

