DROP PROCEDURE IF EXISTS `recPub_procedure`;
DELIMITER ;;
CREATE DEFINER=`root`@`localhost` PROCEDURE `recPub_procedure`(rctPubTable varchar(225),expiration_days int)
BEGIN SET @sqlpubhis = CONCAT('DELETE FROM ',rctPubTable,'WHERE TO_DAYS(NOW())-TO_DAYS(pub_time) >= ',expiration_days); END
;;
DELIMITER ;

